namespace Home\Model\System;

use Home\Model\Entry\MasterManager;

class System630092
{
    /**
     * @brief: 特殊数据内容段
     * @return string
     */
    public static function getSpecialCodeFragment()
    {
        $hour=date( "H");
        $minute=date( "i");
        if($hour<9){
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }
        if($hour == 9 && $minute < 30){
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }

        // 健康疫情模块（lmp=169 酒店版 | lmp = 194 党政版） -- 不上报数据
        if (MasterManager::getEnterPosition() == 172 || MasterManager::getEnterPosition() == 194 /*|| MasterManager::getEnterPosition() == 166*/) {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
            return $data;
        }

        if ( MasterManager::isReportUserInfo() == 1) {
            $data = "";
        } else {
            $data = "TE1FUEcuTG9nLmVycm9yKCJHTyBHTyBHTyAhISEhISEhISIp";
        }
        return $data;
    }
}